import avatarIcon from 'https://img.icons8.com/cotton/2x/gender-neutral-user--v2.png';

export const defaultAvatar = (param: any) => {
  if (
    param === null ||
    param === undefined ||
    param === '' ||
    param === 'empty' ||
    param === 'N/A'
  ) {
    return avatarIcon;
  } else {
    return param;
  }
};
